export async function getTracker(token, type, url) {
    var myHeaders = new Headers({
        Authorization: "Token " + token,
        "Content-Type": "application/json",
    });

    const response = await fetch(`${url}/${type}/`, {
        headers: myHeaders,
        method: "GET",
    })
    return response.json()
}
